package main

func IsNested(s string) bool {
	depth := 0

	for _, char := range s {
		if char == '[' {
			depth++
		} else if char == ']' {
			// If we're closing a bracket and depth is > 1,
			// it means there's a bracket nested inside another
			if depth > 1 {
				return true
			}
			depth--
		}
	}

	return false
}
